optional = false
python-versions = "*"

[package.dependencies]
botocore = ">=1.11.3"
future = "*"
wrapt = "*"

[[package]]
name = "black"
version = "21.9b0"
description = "The uncompromising code formatter."
category = "dev"
optional = false
python-versions = ">=3.6.2"

[package.dependencies]
click = ">=7.1.2"
